paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 2);
            }

            return normalizedValue;
        }
    case 4:
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);

            {
                normalizedValue = rnbo_exp(rnbo_log(normalizedValue) * 1. / 10);
            }

            return normalizedValue;
        }
    case 0:
    case 1:
        {
            value = (value < 0 ? 0 : (value > 15 ? 15 : value));
            let normalizedValue = (value - 0) / (15 - 0);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 16);
            }

            return normalizedValue;
        }
    case 3:
        {
            value = (value < -1 ? -1 : (value > 1 ? 1 : value));
            let normalizedValue = (value - -1) / (1 - -1);

            {
                normalizedValue = rnbo_exp(rnbo_log(normalizedValue) * 1. / 0.5);
            }

            return normalizedValue;
        }
    default:
        index -= 8;

        if (index < this.p_01.getNumParameters())
            return this.p_01.convertToNormalizedParameterValue(index, value);

        index -= this.p_01.getNumParameters();

        if (index < this.p_02[0].getNumParameters()) {
            {
                return this.p_02[0].convertToNormalizedParameterValue(index, value);
            }
        }

        index -= this.p_02[0].getNumParameters();

        if (index < this.p_03.getNumParameters())
            return this.p_03.convertToNormalizedParameterValue(index, value);

        index -= this.p_03.getNumParameters();

        if (index < this.p_04[0].getNumParameters()) {
            {
                return this.p_04[0].convertToNormalizedParameterValue(index, value);
            }
        }

        return value;
    }
}

